	public static string GetIcon(string title)
	{
		if (HpIcons.AppTitles.ContainsKey(title))
		{
			try
			{
				// Get the Type object corresponding to MyClass.
				Type myType = typeof(HpIcons);
				// Get the PropertyInfo object by passing the property name.
				PropertyInfo myPropInfo = myType.GetProperty(HpIcons.AppTitles[title]);
				return (string)myPropInfo.GetValue(null, null);

				
			}
			catch (NullReferenceException e)
			{
				Console.WriteLine("The property does not exist in MyClass." + e.Message);
			}


		}

		return HpIcons.USR;
	}

	public static string GetIcon(BaseHpApp app)
	{
			try
			{
				// Get the Type object corresponding to MyClass.
				Type myType = typeof(HpIcons);
				// Get the PropertyInfo object by passing the property name.
				PropertyInfo myPropInfo = myType.GetProperty(HpIcons.BaseApps[app]);
				return (string)myPropInfo.GetValue(null, null);


			}
			catch (NullReferenceException e)
			{
				Console.WriteLine("The property does not exist in MyClass." + e.Message);
			}

		return HpIcons.USR;

	}

	public static string GetIcon(byte app)
	{
		if (Enum.IsDefined(typeof(BaseHpApp), app))
			return GetIcon((BaseHpApp)app);
		else
			return HpIcons.Unknown;
	}

